import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  render() {
    return React.createElement('span', {className: 'lable lable-dange', id:'1'}, 'Appcomponent');

    <nav className="navbar navbar-inverse">
                <div className="container-fluid">
                    <a className="navbar-brand" >Bai2: Component</a>
                    <ul className="nav navbar-nav">
                        <li className="active">
                            <a >Home</a>
                        </li>
                        <li>
                            <a >List</a>
                        </li>
                    </ul>
                </div>
            </nav>
  }
}

export default App;
